import { useState, useEffect } from "react";
import Layout from "../components/layout/layout";

function Cart() {
  const [cart, setCart] = useState([]);

  useEffect(() => {
    setCart(JSON.parse(sessionStorage.getItem("cart")));
  }, []);
  console.log(cart);

  return (
    <Layout>
      <h1>Test</h1>
    </Layout>
  );
}

export default Cart;
